import CountTo from 'vue-count-to'
import { getPreview } from '@/api/user'

export default {
  data() {
    return {
      carsCount: 0,
      times: 0,
      waitPayCount: 0,
      illegalCount: 0
    }
  },
  created() {
    this.getPreview()
  },
  components: {
    CountTo
  },
  methods: {
    handleSetLineChartData(type) {
      this.$emit('handleSetLineChartData', type)
    },
    getPreview() {
      getPreview().then(response => {
        this.carsCount = response.data.carsCount
        this.waitPayCount = response.data.waitPayCount
        this.times = response.data.times
        this.illegalCount = response.data.illegalCount
      })
    }
  }
}
